import React, { Component } from 'react';
import MainImages from './components/MainImages';
import Brands from './components/Brands';
import Categories from './components/Categories';
class Home extends Component {
  render() {
    return (
        <div>
          <MainImages/>
      <Brands/>
      <br/><br/><br/><br/><br/><br/>
      <Categories/>
        </div>
    );
  }
}

export default Home;
